import React, {useEffect,useState} from "react";

function Fetch(){
    const [users,setUsers] = useState([]);

    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res)=>res.json())
        .then((data)=>{
            setUsers(data);
        })

        .catch((error)=>{
            console.log("Error:", error);
        })
    }, [])
    
    return(
        <div>
            <ul>
                {use}
            </ul>
        </div>
    )
}

export default Fetch;
